import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

index:{
    backgroundColor:'red',
    justifyContent:'center',
    alignItems:'center',
},

indexImg:{
    height:200,
    resizeMode:'cover',
    width:200,
},

});
